import React from 'react'
import './style.css';

function Configuration3( {handleClick} ) {
  return (
    <div className="config">
      <div className="select-1" onChange={ e => {
        handleClick(e.target.value)
      }}> 
        <input type="radio" value="A" name="select-1" /> A
        <input type="radio" value="B" name="select-1" /> B
        <input type="radio" value="C" name="select-1" /> C
      </div>
    </div>
  )
}

export default Configuration3
